import Layout from '../components/Layout';



const Login = () =>  {

   return  (
    <Layout>
        <div>
           
           <button>Login</button>

           <Dashboard />
        </div>
    </Layout>

    );
};






const Dashboard = () =>  {

    return  (
     <Layout>
         <div>

            <button>Logout</button>
         </div>
     </Layout>
 
     );
 };
 


export default Login;
